/******************************
Name:         Systick_Init
Description:  Initializes systick Timer
Input:        none
Output:       none
Source(s):    none
*******************************/
void Systick_Init(void)
{
    SysTick->CTRL = 0;                                           //Disable SysTick timer
    SysTick->LOAD = 0x00FFFFFF;                                  //Maximum reload value
    SysTick->VAL = 0;                                            //Clear Counter
    SysTick->CTRL = 0x00000005;                                  //Enable SysTick
}

/******************************
Name:         systick_delay_ms
Description:  waits a inputed amount of ms
Input:        "delay_time" is the amount of ms to delay for
Output:       none
Source(s):    none
*******************************/
void systick_delay_ms(uint32_t delay_time)
{
    delay_time = delay_time*48000;  //Converts delay_time to cycles
    while (delay_time > 16777215)   //While the delay_time is longer than the max reload of the systick timer
    {
        SysTick->LOAD = (16777215); //Loads Systick to max reload
        SysTick->VAL = 0;   //Clears the counter to restart

        while ((SysTick->CTRL & 0x00010000) == 0);  //Waits until timer runs out
        delay_time = delay_time - 16777215; //Subtracts one full reload of the systick from the delay_time
    }

    SysTick->LOAD = (delay_time);   //Loads the remaining cycles to the systick timer
    SysTick->VAL = 0;   //Clears the counter to restart

    while ((SysTick->CTRL & 0x00010000) == 0);  //Waits until the timer runs out

}


/******************************
Name:         writeEGR
Description:  prints "EGR 326" to LCD
Input:        none
Output:       none
Source(s):    none
*******************************/
void writeEGR(void)
{
    ST7735_FillScreen(ST7735_Color565(0, 0, 0));

    ST7735_DrawCharS(3, 80, 'E', ST7735_Color565(255, 20, 147),
                     ST7735_Color565(0, 0, 0), 3);
    ST7735_DrawCharS(19, 80, 'G', ST7735_Color565(255, 20, 147),
                     ST7735_Color565(0, 0, 0), 3);
    ST7735_DrawCharS(35, 80, 'R', ST7735_Color565(255, 20, 147),
                     ST7735_Color565(0, 0, 0), 3);
    ST7735_DrawCharS(50, 80, ' ', ST7735_Color565(255, 20, 147),
                     ST7735_Color565(0, 0, 0), 3);
    ST7735_DrawCharS(66, 80, '3', ST7735_Color565(255, 20, 147),
                     ST7735_Color565(0, 0, 0), 3);
    ST7735_DrawCharS(82, 80, '2', ST7735_Color565(255, 20, 147),
                     ST7735_Color565(0, 0, 0), 3);
    ST7735_DrawCharS(98, 80, '6', ST7735_Color565(255, 20, 147),
                     ST7735_Color565(0, 0, 0), 3);
}

