/******************************
 Name:         RotaryPinInit
 Description:  Initializes all output, and input pins for the rotary encoder
               Dont Forget to init the interrupts as well
 Input:        none
 Output:       none
 Source(s):    none
 *******************************/
void rotaryPinInit(void)
{
    MAP_GPIO_setAsInputPinWithPullUpResistor(GPIO_PORT_P6, GPIO_PIN0+GPIO_PIN1+GPIO_PIN2); //Sets P6.0,P6.1,P6.2 as an input pin with pull up resistor
    MAP_GPIO_setAsOutputPin(GPIO_PORT_P2, GPIO_PIN0+GPIO_PIN1+GPIO_PIN2); //Sets P2.0 as an output pin
    MAP_GPIO_setOutputLowOnPin(GPIO_PORT_P2, GPIO_PIN0+GPIO_PIN1+GPIO_PIN2);

    //enabling interrupts
    MAP_GPIO_clearInterruptFlag(GPIO_PORT_P6, GPIO_PIN0+GPIO_PIN1+GPIO_PIN2);   //Sets up Interrupt for on rising edge
    MAP_GPIO_enableInterrupt(GPIO_PORT_P6, GPIO_PIN0+GPIO_PIN1+GPIO_PIN2);
    MAP_Interrupt_enableInterrupt(INT_PORT6);
    MAP_GPIO_interruptEdgeSelect(GPIO_PORT_P6, GPIO_PIN2+GPIO_PIN0+GPIO_PIN1,GPIO_HIGH_TO_LOW_TRANSITION);
}
